import React from "react";
import { View, Text,Image } from "react-native";
import storyring from "../../images/global/Storyring.png";
import messages from "../../icons/messages.png";
import tw from "twrnc";

export default function General() {
  return (
    <View style={tw`items-center`}>
      <View style={tw`flex items-center`}>
        <Image style={tw`w-[120px] h-[120px]`} source={storyring} />

        <Image style={tw`w-[52px] h-[52px] rounded-full absolute top-[4px] left-[4px]`} source={messages} />
      </View>
    </View>
  );
}
